import React from "react";
import { useOutletContext, Link } from "react-router-dom";


const Posts = () => {
    const [itemSell, useItemSell] = useOutletContext();
    return (
         itemSell.map((indivPost, idx) => {
            console.log(indivPost)
            return (
                <div className="postDiv" key={idx}>
                    <div>
                        <p className="p">Post Author: {indivPost.author.username}</p>
                    </div>
                    <div>
                        <p className="p">Location: {indivPost.location}</p>
                    </div>
                    <div>
                        <p>Item: {indivPost.title}</p>
                    </div>
                    <div>
                        <p className="p">Price: {indivPost.price}</p>
                    </div>
                    <div>
                        <Link to={`/posts/${idx}`}>More Info</Link>
                    </div>
                </div>
            ) 
        })

    )
}

export default Posts;
